import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Link as RouterLink } from 'react-router-dom';
import { Button } from '@mui/material';
import Navbar from './navbar';
import MainPart from './mainPart';
import Documentation from './documentation';
import TheProject from './theproject';

function App() {
    return (
        <Router>
            <div className="App">
                <Navbar />
                <Button component={RouterLink} to="/" variant="contained">
                    Accueil
                </Button>
                <Button component={RouterLink} to="/theproject" variant="contained">
                    TheProject
                </Button>
                <Button component={RouterLink} to="/documentation" variant="contained">
                    Documentation
                </Button>
                <Switch>
                    <Route exact path="/" component={MainPart} />
                    <Route path="/theproject" component={TheProject} />
                    <Route path="/documentation" component={Documentation} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
